    number: '6'
    value: 'This amendment is needed to realign the balances beginning and ending
      with the Committee books and records. To avoid further problems of this nature,
      the Committee has instituted new procedures to avoid misalignment in the future.
      The Fairfax County Democratic Committee is an all volunteer committee with no
      paid staff of any kind. No other entities pay any compensation for their employees
      to work for the committee either part time or full time. No payroll expenses
      are incurred. The committee maintains both Federal and Non federal accounts,
      and it has elected not to allocate its administrative expenses between accounts,
      so all administrative overhead expenses of the Committee are paid with Federal
      funds.The Committee does not engage in any fundraising on behalf of candidates
      for Federal office, so all of its reported fundraising expenses are party fund
      raising.

